{/*import React, { useEffect, useState } from "react";
import axios from "axios";
import ReactHtmlParser from "react-html-parser";

function MapLocation() {
  const [geoFrame, setGeoFrame] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      const url = 'https://goo.gl/maps/dvjRo7QRJ26TZa1h6';  // URL de Google Maps
      const response = await axios.get(url);
      const html = response.data;
      const elements = ReactHtmlParser(html);
      const geoFrame = elements.find(
        (el) =>
          el.type === "iframe" &&
          el.props.src.includes("maps.google.") &&
          el.props["data-geo"]
      );
      setGeoFrame(geoFrame);
    };
    fetchData();
  }, []);

  return <div>{geoFrame}</div>;
}

export default MapLocation; */}
